@Test
	public void testHashCharSequenceIntIntLongArray() {
		for (int i = 0; i < BUF_SIZE; i+=2) {
			long lsaw =SpookyHash64.hash(charSeqBuf, 0, i/2, 0L);
			lsaw &= 0x00000000ffffffffL;
			assertEquals(String.format("results %d: ", i), expected[i], lsaw);
		}
	}

